script: |
  super -f text -I q3258.spq | sort > q3258.out

inputs:
  - name: q3258.spq
    data: |
      SELECT - col2 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE + col0 * + - col2 * + 46 NOT BETWEEN col0 * - 69 AND col0;
  - name: tab2

outputs:
  - name: q3258.out
    data: |
      -23
      -40
      -58
